import React from 'react';
import { Route, Routes } from 'react-router-dom';
import EnseignantList from '../enseignant/EnseignantList';
import EleveList from '../eleve/EleveList'; // Assuming you have an EleveList component
import DashboardLayout from './DashboardLayout';

const Dashboard = () => {
    return (
        <DashboardLayout>
            <Routes>
                <Route path="/enseignants" element={<EnseignantList />} />
                <Route path="/eleves" element={<EleveList />} />
                {/* Add other routes as needed */}
            </Routes>
        </DashboardLayout>
    );
};

export default Dashboard;
